import React, { useEffect, useState } from 'react'

function App() {
  const [backendData, setBackendData] = useState ([{}])

  useEffect (() => {
    fetch ("http://localhost.com:8000/api").then (
      response => response.json ()
    ).then (
      data => {
        setBackendData (data)
      }
    ).catch (err => console.log (err))
  }, [/* empty array for only running on initial render */])

  return (
    <div>
      {(typeof backendData.cars === 'undefined') ? (
        <p>Loading...</p>
      ) : (
          backendData.users.map ((car, i) => (
            <p key={i}>{car}</p>
          ))
      )}
    </div>
  )
}

export default App
